def custom_encode_2(val: int) -> np.ndarray:
    if val == 0:
        return np.array([0, 0], dtype=np.float32)
    elif val == 1:
        return np.array([0, 1], dtype=np.float32)
    elif val == 2:
        return np.array([1, 0], dtype=np.float32)
    else:
        raise ValueError("Value must be 0, 1, or 2.")

def custom_encode_status(val: int) -> np.ndarray:
    if val == 0:
        return np.array([0, 0, 0], dtype=np.float32)
    elif val == 1:
        return np.array([0, 0, 1], dtype=np.float32)
    elif val == 2:
        return np.array([0, 1, 0], dtype=np.float32)
    elif val == 3:
        return np.array([1, 0, 0], dtype=np.float32)
    else:
        raise ValueError("Local board status must be 0, 1, 2, or 3.")

def custom_encode_coord(val: int) -> np.ndarray:
    if val < 0:
        return np.array([0, 0], dtype=np.float32)
    return custom_encode_2(val)


class Net(nn.Module):
    def __init__(self):
        super(Net, self).__init__()
        self.fc1 = nn.Linear(195, 256)
        self.bn1 = nn.BatchNorm1d(256)
        self.dropout1 = nn.Dropout(0.3)
        
        self.fc2 = nn.Linear(256, 128)
        self.bn2 = nn.BatchNorm1d(128)
        self.dropout2 = nn.Dropout(0.3)

        self.fc_mid = nn.Linear(128, 64)
        self.bn_mid = nn.BatchNorm1d(64)
        self.dropout_mid = nn.Dropout(0.3)

        self.fc3 = nn.Linear(64, 1)

        self.load_state_dict(weights)  
        
    def forward(self, x):
        x = F.relu(self.bn1(self.fc1(x)))
        x = self.dropout1(x)
        x = F.relu(self.bn2(self.fc2(x)))
        x = self.dropout2(x)
        x = F.relu(self.bn_mid(self.fc_mid(x)))
        x = self.dropout_mid(x)
        x = self.fc3(x)
        return x
    
def evaluate_line(line: list) -> float:
    """
    Evaluates a line (row, column, or diagonal) of 3 cells.
    If it has exactly two 1's and one empty cell (0), returns a bonus of +7.
    If it has exactly two 2's and one empty cell, returns a penalty of -9.
    Otherwise, returns 0.
    """
    if line.count(1) == 2 and line.count(0) == 1:
        return 0.7
    elif line.count(2) == 2 and line.count(0) == 1:
        return -0.9
    else:
        return 0

class StudentAgent:
    def __init__(self, depth: int = 3):
        self.depth = depth
        self.device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
        self.model = Net().to(self.device)
        self.model.eval()
        self.moves = 0

    def extract_features(self, state: State) -> np.ndarray:
        board_flat = state.board.reshape(-1)  # 81 cells
        global_board_features = np.array([custom_encode_2(val) for val in board_flat]).flatten()  # 81*2 = 162 features
        
        local_board_flat = state.local_board_status.reshape(-1)  # 9 cells
        local_board_features = np.array([custom_encode_status(val) for val in local_board_flat]).flatten()  # 9*3 = 27 features
        
        fill_num_feature = custom_encode_2(state.fill_num)  # 2 features
        
        if state.prev_local_action is None:
            prev_r, prev_c = -1, -1
        else:
            prev_r, prev_c = state.prev_local_action
        prev_r_enc = custom_encode_coord(prev_r)  # 2 features
        prev_c_enc = custom_encode_coord(prev_c)  # 2 features
        prev_action = np.concatenate([prev_r_enc, prev_c_enc])  # 4 features
        
        features = np.concatenate([global_board_features, local_board_features, fill_num_feature, prev_action])
        return features

    def evaluate_sub_board(self, sub_board: np.ndarray) -> float:
        """Evaluate a single 3x3 sub-board using 2-in-a-row heuristics."""
        val = 0
        # Evaluate rows and columns.
        for i in range(3):
            row = list(sub_board[i, :])
            col = list(sub_board[:, i])
            val += evaluate_line(row)
            val += evaluate_line(col)
        # Evaluate diagonals.
        diag1 = [int(sub_board[i, i]) for i in range(3)]
        diag2 = [int(sub_board[i, 2 - i]) for i in range(3)]
        val += evaluate_line(diag1)
        val += evaluate_line(diag2)
        return val

    def evaluate_meta_board(self, meta: np.ndarray) -> float:
        """
        Evaluate the meta-board (the 3x3 matrix of local board statuses).
        If a row, column, or diagonal has two wins for player1 (status 1) and one open (status 0), add a big bonus (+100),
        and vice versa for player2.
        """
        meta_list = meta.tolist()
        def eval_meta_line(line: list) -> float:
            if line.count(1) == 2 and line.count(0) >= 1:
                return 1
            elif line.count(2) == 2 and line.count(0) >= 1:
                return -1
            else:
                return 0
        val = 0
        for i in range(3):
            row = meta_list[i]
            col = [meta_list[0][i], meta_list[1][i], meta_list[2][i]]
            val += eval_meta_line(row)
            val += eval_meta_line(col)
        diag1 = [meta_list[i][i] for i in range(3)]
        diag2 = [meta_list[i][2 - i] for i in range(3)]
        val += eval_meta_line(diag1)
        val += eval_meta_line(diag2)
        return val

    def heuristic_eval(self, state: State) -> float:
        """Compute a heuristic evaluation based on sub-board and meta-board factors."""
        value = 0.0
        # Evaluate each local board.
        for i in range(3):
            for j in range(3):
                sub_board = state.board[i, j, :, :]  # 3x3 sub-board
                local_status = state.local_board_status[i, j]
                if local_status == 1:
                    value += 50  # Player1 already won the sub-board.
                elif local_status == 2:
                    value -= 50  # Player2 already won.
                elif local_status == 3:
                    pass  # Draw: no bonus.
                else:
                    # Board still in play; evaluate 2-in-a-row setups.
                    value += self.evaluate_sub_board(sub_board)
        # Evaluate meta-board.
        value += self.evaluate_meta_board(state.local_board_status)
        return value

    def evaluate(self, state: State) -> float:
        """Original evaluation function used in early game (if game is terminal, etc.)."""
        if state.is_terminal():
            util = state.terminal_utility()
            return 1 if util == 1.0 else -1 if util == 0.0 else 0
        # In early game, we may use the neural networks evaluation.
        features = self.extract_features(state)
        features_tensor = torch.tensor(features, dtype=torch.float32).to(self.device).unsqueeze(0)
        score = self.model(features_tensor).item()
        return score

    def minimax(
        self,
        state: State,
        depth: int,
        is_max: bool,
        alpha: float,
        beta: float
    ) -> tuple[float | None, Action | None]:
        if time.time() - self.search_start_time >= self.search_time_limit * 0.95:
            return None, None

        if depth == 0 or state.is_terminal():
            return self.evaluate(state), None

        valid_actions = state.get_all_valid_actions()
        best_action = None

        if is_max:
            max_eval = -float('inf')
            for action in valid_actions:
                new_state = state.change_state(action)
                eval_score, _ = self.minimax(new_state, depth - 1, False, alpha, beta)
                if eval_score is None:
                    return None, None
                if eval_score > max_eval:
                    max_eval = eval_score
                    best_action = action
                alpha = max(alpha, eval_score)
                if beta <= alpha:
                    break
            return max_eval, best_action
        else:
            min_eval = float('inf')
            for action in valid_actions:
                new_state = state.change_state(action)
                eval_score, _ = self.minimax(new_state, depth - 1, True, alpha, beta)
                if eval_score is None:
                    return None, None
                if eval_score < min_eval:
                    min_eval = eval_score
                    best_action = action
                beta = min(beta, eval_score)
                if beta <= alpha:
                    break
            return min_eval, best_action

    def minimax_heuristics(self, state: State, depth: int, is_max: bool, alpha: float, beta: float) -> tuple[float | None, Action | None]:
        """Minimax using only heuristic evaluation (used for later game)."""
        if time.time() - self.search_start_time >= self.search_time_limit * 0.95:
            return None, None
        if depth == 0 or state.is_terminal():
            return self.heuristic_eval(state), None

        valid_actions = state.get_all_valid_actions()
        best_action = None
        if is_max:
            max_eval = -float('inf')
            for action in valid_actions:
                new_state = state.change_state(action)
                eval_score, _ = self.minimax_heuristics(new_state, depth - 1, False, alpha, beta)
                if eval_score is None:
                    return None, None
                if eval_score > max_eval:
                    max_eval = eval_score
                    best_action = action
                alpha = max(alpha, eval_score)
                if beta <= alpha:
                    break
            return max_eval, best_action
        else:
            min_eval = float('inf')
            for action in valid_actions:
                new_state = state.change_state(action)
                eval_score, _ = self.minimax_heuristics(new_state, depth - 1, True, alpha, beta)
                if eval_score is None:
                    return None, None
                if eval_score < min_eval:
                    min_eval = eval_score
                    best_action = action
                beta = min(beta, eval_score)
                if beta <= alpha:
                    break
            return min_eval, best_action

    def choose_action(self, state: State) -> Action:
        if np.count_nonzero(state.board) <= 1:
            self.moves = 0
        print(self.moves)
        self.search_time_limit = 2.9  # seconds
        self.search_start_time = time.time()
        best_action = None
        is_max = True if state.fill_num == 1 else False

        if self.moves < 25:
            current_depth = 3
            while time.time() - self.search_start_time < self.search_time_limit:
                result = self.minimax(state, current_depth, is_max, -float('inf'), float('inf'))
                if result[0] is None:
                    break
                score, action = result
                if action is not None:
                    best_action = action
                current_depth += 1
        else:
            # Use the separate minimax with heuristics for later game.
            result = self.minimax_heuristics(state, 7, is_max, -float('inf'), float('inf'))
            score, action = result
            best_action = action
        self.moves += 1
        return best_action if best_action is not None else state.get_random_valid_action()


def run(your_agent: StudentAgent, opponent_agent: StudentAgent, start_num: int):
    your_agent_stats = {"timeout_count": 0, "invalid_count": 0}
    opponent_agent_stats = {"timeout_count": 0, "invalid_count": 0}
    turn_count = 0
    
    state = State(fill_num=start_num)
    
    while not state.is_terminal():
        turn_count += 1

        agent_name = "your_agent" if state.fill_num == 1 else "opponent_agent"
        agent = your_agent if state.fill_num == 1 else opponent_agent
        stats = your_agent_stats if state.fill_num == 1 else opponent_agent_stats

        start_time = time.time()
        action = agent.choose_action(state.clone())
        end_time = time.time()
        
        random_action = state.get_random_valid_action()
        if end_time - start_time > 3:
            print(f"{agent_name} timed out!")
            stats["timeout_count"] += 1
            action = random_action
        if not state.is_valid_action(action):
            print(f"{agent_name} made an invalid action!")
            stats["invalid_count"] += 1
            action = random_action
                
        state = state.change_state(action)

    print(f"== {your_agent.__class__.__name__} (1) vs {opponent_agent.__class__.__name__} (2) - First Player: {start_num} ==")
        
    if state.terminal_utility() == 1:
        print("You win!")
    elif state.terminal_utility() == 0:
        print("You lose!")
    else:
        print("Draw")

    for agent_name, stats in [("your_agent", your_agent_stats), ("opponent_agent", opponent_agent_stats)]:
        print(f"{agent_name} statistics:")
        print(f"Timeout count: {stats['timeout_count']}")
        print(f"Invalid count: {stats['invalid_count']}")
        
    print(f"Turn count: {turn_count}\n")

